INSERT INTO `news` (`id_news`, `judul`, `berita`, `link`, `gambar`) VALUES
(1, 'Penting! Pahami Basic Skincare untuk Kulit Wajah', 'Penting! Pahami Basic Skincare Untuk Kulit Wajah\r\n\r\nKamu pasti sudah tidak asing lagi dengan yang namanya skincare. Skincare merupakan kegiatan merawat kulit dengan kandungan tertentu agar mendapatkan nutrisi, vitamin dan menjadi lembab sehingga mendukung kesehatan dan kecantikan. \r\nAda banyak sekali produk perawatan wajah yang ditawarkan oleh berbagai brand dengan keunggulan, khasiat serta kandungan yang ada di dalamnya. Untuk basic skincare wajah ada toner, facial wash, sunscreen, moisturizer, serum, dll.', 'https://www.kompasiana.com/sabellahrf/63d0e814c3bdbf5ad8526d62/penting-pahami-basic-skincare-untuk-kulit-wajah', 'https://assets.kompasiana.com/items/album/2023/01/25/penting-png-63d0e587c3bdbf6112057e92.png?t=o&v=770'),
(2, 'Penyebab Kulit Wajah Mengelupas Selain Karena Kondisi Kulit Kering', 'Fimela.com, Jakarta Ada tiga tipe kulit, yaitu normal, kering dan berminyak. Ketiga tipe kulit tersebut bisa dilihat dari banyaknya minyak yang ada di wajah. Kulit berminyak tentunya memiliki kandungan paling banyak di antara tipe kulit yang lain. Sebaliknya, kulit kering punya sedikit sekali minyak atau bahkan tidak ada sama sekali. Sementara tipe kulit normal kandungan minyaknya cukup, tidak terlalu banyak atau tidak terlalu sedikit.\r\nPada tipe kulit kering, karena kandungan minyak di wajah hanya sedikit, maka ada beberapa permasalahan yang cukup sering dihadapi. Contohnya kulit yang terlalu kering bisa membuat kulit wajah jadi mengelupas. Namun kulit yang mengelupas tidak selalu karena kulit yang kering. Bisa juga karena hal lainnya', 'https://www.fimela.com/beauty/read/5166098/penyebab-kulit-wajah-mengelupas-selain-karena-kondisi-kulit-kering', 'https://cdn0-production-images-kly.akamaized.net/2OJWl9UE9_LVifpro_PkLsR1fPA=/680x383/smart/filters:quality(75):strip_icc():format(jpeg)/kly-media-production/medias/3974331/original/089714300_1648162477-shutterstock_2091325087.jpg'),
(3, 'Jenis Toner yang Tepat untuk Kulit Berjerawat dan Berminyak', 'Fimela.com, Jakarta Kulit berminyak merupakan kondisi ketika kelenjar sebasea pada kulit menghasilkan terlalu banyak sebum. Sebum adalah minyak alami yang berfungsi melapisi dan membantu merawat kulit tetap lembab. Namun apabila minyak yang diproduksi terlalu banyak maka dapat membuat kulit terlihat mengkilap dan dapat memicu timbulnya masalah baru, yaitu jerawat.', 'https://www.fimela.com/beauty/read/5169604/jenis-toner-yang-tepat-untuk-kulit-berjerawat-dan-berminyak', 'https://cdn0-production-images-kly.akamaized.net/hzUINRZjddzjFnQmytCai1GeYX8=/680x383/smart/filters:quality(75):strip_icc():format(jpeg)/kly-media-production/medias/4279284/original/096075600_1672643705-Purifying_Hydra_Toner___Hydra_Boost_Oil_Free_Moisturizer_.jpg'),
(4, 'Beauty Review: Menjajal Skincare yang Dipakai Natasha Wilona untuk Tampil Glowing Natural', 'Fimela.com, Jakarta Tuntutan akan penampilan yang harus tampil prima membuat Natasha Wilona harus menjaga kesehatan kulit. Ia pun melakoni serangkaian rutinitas skincare yang menjadi rahasia di balik wajah glowing.', 'https://www.fimela.com/beauty/read/5189746/beauty-review-menjajal-skincare-yang-dipakai-natasha-wilona-untuk-tampil-glowing-natural', 'https://cdn1-production-images-kly.akamaized.net/AAXVBxAB2unHtYYXgy9Ak9h-jnA=/680x383/smart/filters:quality(75):strip_icc():format(jpeg)/kly-media-production/medias/4302991/original/072395100_1674665745-Screenshot_2023-01-25_234603.jpg'),
(5, '5 Tahapan Basic Skincare untuk Pemula Agar Tampil Glowing', 'Skincare atau perawatan wajah termasuk salah satu hal esensial bagi manusia, khususnya bagi yang menginginkan kulit glowing. Penggunaan skincare mampu menjaga kesehatan kulit, membuat kulit wajah terhindar dari berbagai permasalahan seperti kulit kusam hingga penuaan dini', 'https://www.detik.com/bali/berita/d-6534272/5-tahapan-basic-skincare-untuk-pemula-agar-tampil-glowing', 'https://akcdn.detik.net.id/community/media/visual/2023/01/20/ilustrasi-skincare_169.jpeg?w=700&q=90'),
(6, 'Jangan Skip Rutinitas Skincare Malam Ini Kalau Ingin Punya Kulit Glowing dan Kenyal di Pagi Hari!', 'Tahukah Beauties? Ternyata, malam hari adalah waktu yang pas untuk melakukan perawatan kulit. Namun, bukan berarti perawatan kulit di pagi hari tidak berguna, ya. Lebih tepatnya, dua waktu perawatan tersebut sama pentingnya dan saling mempengaruhi.', 'https://www.beautynesia.id/beauty/jangan-skip-rutinitas-skincare-malam-ini-kalau-ingin-punya-kulit-glowing-dan-kenyal-di-pagi-hari/b-269284', 'https://akcdn.detik.net.id/visual/2022/04/13/tiffany-young_169.jpeg?w=700&q=90'),
