INSERT INTO `tipewajah` (`kode_tipewajah`, `nama_tipewajah`, `det_tipewajah`, `srn_tipewajah`, `gambar`) VALUES
(1, 'Kulit Wajah Normal', 'Jenis Kulit Wajah Normal merupakan kondisi kulit yang memiliki keseimbangan antara jumlah kandungan air dan minyak. Sehingga, kondisinya tidak terlalu kering, tapi juga tidak terlalu berminyak.Ciri-ciri dari jenis kulit wajah normal adalah memiliki pori-pori hampir tidak terlihat, tidak terlalu sensitif, bertekstur elastis dan kenyal. Umumnya, jenis-jenis kulit wajah yang normal jarang memiliki masalah kulit.', 'Perawatan yang disarankan: <br>\r\n1. Bersihkan wajah dua kali sehari dengan facial wash yang lembut dan tidak berbusa.<br>\r\n2. Gunakan pelembap yang ringan dan menghidrasi.<br>\r\n3. Lindungi kulit dari kerusakan akibat sinar matahari dengan sunscreen SPF 30 atau lebih.<br>\r\n4. Pelembap yang direkomendasikan untuk kulit normal adalah moisturizer yang mengandung hyaluronic acid supaya kulit tetap lembap.<br>\r\n5. Pakai serum untuk mencerahkan, menghidrasi, atau menghaluskan, tergantung kebutuhan kulitmu.<br>\r\n6. Tidak terlalu banyak menggunakan produk skincare. <br>\r\n7. Menggunakan produk skincare yang mengandung AHA/BHA untuk eksfoliasi secara berlebihan dapat menyebabkan kulit mengelupas yang bisa mendorong produksi sebum berlebih.', 'Normal.jpg'),
(2, 'Kulit Wajah Berminyak', 'Jenis Kulit Wajah Berminyak yang satu ini bisa dibilang jenis kulit yang paling mudah untuk dideteksi. Karena biasanya orang yang memiliki kulit wajah berminyak pasti tampilan wajahnya terlihat mengilap, cenderung licin, berkomedo dan memiliki pori-pori wajah yang besar. Kulit wajah yang mengilap itu dikarenakan produksi minyak atau sebum yang berlebih. Nah, apabila sebum berlebih itu dibiarkan dan tidak dirawat bisa menyebabkan kulit semakin berminyak, pori-pori tersumbat, dan membuat kulit rentan muncul jerawat.  Walaupun begitu, sisi positif dari pemilik kulit wajah berminyak memiliki tingkat yang rendah terjadinya penuaan dan munculnya kerutan pada wajah.', 'Perawatan yang disarankan: <br>\r\n1. Menggunakan skincare yang tidak mengandung banyak minyak<br>\r\n2. Pakai pelembab yang cocok dengan kulitmu atau yang kadar lebih sedikit<br>\r\n3. Cocok dengan skincare yang teksturnya berbentuk gel', 'Berminyak.jpg'),
(3, 'Kulit Wajah Kering', 'Pemilik Kulit Wajah Kering kulit kering akan lebih rentan terhadap keriput, jadi tidak heran kalau garis halus lebih mudah terlihat. Wajah pemilik kulit kering juga lebih rentan terlihat kusam dan tidak bercahaya. Kulit kering ini biasa jadi masalah yang sangat berarti jika kamu tinggal atau melakukan traveling di tempat dengan cuaca dingin.', 'Perawatan yang disarankan: <br>\r\n1. Menjaga pola makan<br>\r\n2. Minum air yang cukup <br>\r\n3. Hidrasi kulit wajahmu dengan sheet mask<br>\r\n4. Jangan terlalu sering mencuci wajah dengan air hangat <br>\r\n5. Memilih skincare yang melembabkan seperti hydrating toner<br>\r\n6. Lebih cocok menggunakan skincare dengan tekstur krim atau balm dan hindari skincare berbahan dasar alkohol', 'Kering.jpg'),
(4, 'Kulit Wajah Kombinasi', 'Jenis Kulit Wajah Kombinasi ini memang sedikit membingungkan untuk yang belum mengetahuinya. Kulit wajah kombinasi merupakan perpaduan antara kulit berminyak dan kulit kering. Biasanya, orang yang kulit wajahnya kombinasi memiliki kulit berminyak di zona T (area dagu, hidung, dan dahi), dan kulit kering di area pipi. Untuk merawat kulit wajah kombinasi memang perlu usaha lebih, dikarenakan kondisi wajah terdiri dari perpaduan kondisi kulit. ', 'Perawatan yang disarankan:<br>\r\n1. Pilih pelembab khusus kulit kombinasi<br>\r\n2. Bersihkan wajah dengan sabun yang lembut<br>\r\n3. Cuci muka dengan air hangat<br>\r\n4. Menggunakan toner<br>\r\n5. Melakukan eksfoliasi', 'Kombinasi.jpg'),
(5, 'Kulit Wajah Sensitif', 'Jenis Kulit Wajah Sensitif ini biasanya rentan mengalami alergi/iritasi, ruam, dan mudah bereaksi terhadap faktor tertentu, seperti makanan, cuaca, lingkungan, atau produk perawatan wajah yang tidak cocok. Selain itu, kulit wajah sensitif juga mudah kering, terkelupas, terasa perih, atau bahkan memerah.', 'Perawatan yang disarankan: <br>\r\n1. Hindari produk skincare dengan kandungan alkohol<br>\r\n2. Pilih skincare dengan kandungan bahan alami yang aman untuk kulit sensitif<br>\r\n3. Banyak minum air putih<br>\r\n4. Apabila muncul kemerahan saat memakai salah satu skincare, disarankan untuk hentikan penggunaan skincare tersebut', 'Sensitif.jpg');
